import logo from '../../utils/logoG.png'

 export const Footer = ()=>{
    return(
        <footer>
            created by Johan Cortes
            <a href='https://github.com/jako12287' target='_blank' ><image src={logo}/></a>
            <a href='https://co.linkedin.com/' target='_blank'></a>
        </footer>
    )
}
